import React from 'react';
import './App.css';


function Home() {
    return (

        <div class="center">

            <h1>Welcome to the Watch Organizer App!</h1>

            You can build your own collection of watch brands and corresponding watches!

            <img
                src="https://www.worthy.com/blog/wp-content/uploads/2016/05/watch-movement-1-697x283.jpg" />
            You can add different watch brands, and add information for specific watches manufactured by that brand. The database that supports this app will allow you to add, update and delete watches.


        </div>

    );


}


export default Home;
